import React from 'react';
import backgroundImage from './food.jpg';
import Navbar from "../navbar/Navbar.jsx";

const products = [
  // Add your product details here
  { id: 1, name: "Show Me Your Love", price: 9.99, imageUrl: './food.jpg' },
  { id: 2, name: "Camera Lens", price: 9.99, imageUrl: './food.jpg' },
  // ... other products
];

const HeroSection = () => {
  return (
    <div className="relative bg-white overflow-hidden">
      <div className="max-w-7xl mx-auto">
        <div className="relative z-10 pb-8 bg-white sm:pb-16 md:pb-20 lg:max-w-2xl lg:w-full lg:pb-28 xl:pb-32">
          <main className="mt-10 mx-auto max-w-7xl px-4 sm:mt-12 sm:px-6 md:mt-16 lg:mt-20 lg:px-8 xl:mt-28">
            <div className="sm:text-center lg:text-left">
              <h1 className="text-4xl tracking-tight font-extrabold text-gray-900 sm:text-5xl md:text-6xl">
                <span className="block xl:inline">Quan's Kitchen</span>{' '}
                <span className="block text-indigo-600 xl:inline"></span>
              </h1>
            </div>
          </main>
        </div>
      </div>
      <div className="hidden lg:block lg:w-1/2" style={{ backgroundImage: `url(${backgroundImage})`, backgroundSize: 'cover', backgroundPosition: 'center center' }}>
        {/* Empty div to hold background image */}
      </div>
    </div>
  );
};

const Customer = () => {
  return (
    <div className="bg-[url('food.jpg')] h-screen bg-cover">
      <h1 className="text-white text-3xl">Welcome to My Page</h1>
    </div>
  );;
};

export default Customer;
